
Create table SituatieJud (
	IdJud int,
	NumeJudet varchar(100),
	NrInfectati int,
	NrVindecati int,
	NrVaccinati int,
	NrDecedati int )

	select * from SituatieJud;

	alter table SituatieJud
	add Dati date;

	delete from SituatieJud
	where IdJud = 7 and Dati = '2021-12-19'; 

	delete from SituatieJud
	where Dati = '2021-12-1'; 


create table SituatieTara(
NrInfectati int,
NrVindecati int,
NrVaccinati int,
NrDecedati int,
Dati date)

select * from SituatieTara;

